e as the language of the displayed interface.</p>";s:6:"weight";i:4;s:10:"attributes";a:1:{s:10:"data-class";s:34:"js-form-item-site-default-language";}}s:19:"language-operations";a:6:{s:2:"id";s:19:"language-operations";s:6:"plugin";s:4:"text";s:5:"label";s:19:"Modifying languages";s:4:"body";s:399:"<p>Operations are provided for editing and deleting your languages.</p><p>You can edit the name and the direction of the language.</p><p>Deleted languages can be added back at a later time. Deleting a language will remove all interface translations associated with it, and content in this language will be set to be language neutral. Note that you cannot delete the default language of the site.</p>";s:6:"weight";i:5;s:10:"attributes";a:1:{s:10:"data-class";s:18:"dropbutton-wrapper";}}s:17:"language-continue";a:5:{s:2:"id";s:17:"language-continue";s:6:"plugin";s:4:"text";s:5:"label";s:13:"Continuing on";s:4:"body";s:261:"<p>Now that you have an overview of the "Languages" page, you can continue by:<ul><li><a href="[site:url]/admin/config/regional/language/add">Adding a language</a></li><li>Reordering languages</li><li>Editing a language</li><li>Deleting a language</li></ul></p>";s:6:"weight";i:6;}}}',
))
