:5:{s:2:"id";s:22:"language-edit-continue";s:6:"plugin";s:4:"text";s:5:"label";s:13:"Continuing on";s:4:"body";s:218:"<p>Now that you have an overview of the "Edit language" feature, you can continue by:<ul><li>Editing a language</li><li><a href="[site:url]/admin/config/regional/language">Viewing configured languages</a></li></ul></p>";s:6:"weight";i:5;}}}',
